import React from 'react';
import Layout from '../components/main/layout';
import Hero from '../components/main/hero';
import { color, font } from '../layout/main';
//import GreenPost from '../components/main/greenpost';
//import MainSection from '../components/main/main';
//import Embajadores from '../components/main/embajador';
//import Embajada from '../components/main/embajada';
//      <Embajada />
const Main = () => {

  return(
    <Layout>
      <Hero />
      <div className="main">
        <div className="info">

        </div>
        <div className="woman">
        <img src="/static/cusco.png" alt=""/>
        <div className="circle">

        </div>
        </div>
      <style jsx>{`
        .main{
          display: flex;
          width: 100%;
          height: 60vh;
          background: linear-gradient(rgba(0, 0, 0, .1), #fff);
          position: relative;
        }
        .circle{
          width: 65vh;
          height: 65vh;
          border-radius: 50%;
          border: 1px solid rgba(0, 0, 0, .7);
          position: absolute;
          top: 0;
          left: 25%;

        }
        .info{
          flex-grow: 1;
          border: 1px solid red;
        }
        img{
          width: 100%;
          height: 100%;
          object-fit: cover;
          object-position: left center;
        }
        .woman{
          width: 50%;
          justify-content: flex-end;
          position: relative;
          z-index: 10;
        }
      `}
      </style>
      </div>
    </Layout>
  )
}

export default Main;
